import Services from './pages/services';
import BookSlots from './pages/bookSlots';
import ReachUs from './pages/reachUs';
import Help from './pages/help';
import Retail from './pages/retail';

function App() {
  return (
    <Router>
      <div className="container">
        <Navbar />
        {/* <Routes>
